def random():
    headers={'Content-Type': "application/x-www-form-urlencoded"}

    country = countries[int(rd.random()*len(countries))]
    currency = currencies[int(rd.random()*len(currencies))]
    locale = locales[int(rd.random()*len(locales))]
    orig= places[int(rd.random()*len(places))]
    dest = places[int(rd.random()*len(places))]
    while orig == dest:
        dest = places[int(rd.random()*len(places))]


    months = [10,11,12];
    month = months[int(rd.random()*len(months))]
    day = int(30*rd.random() )
    if month == 10: 
        day =int( 22+7*rd.random() )

    data = "cabinclass=Economy&country="+country+"&currency="+currency+"&locale="+locale+"&locationSchema=iata&originplace="+orig+"&destinationplace="+dest+"&outbounddate=2018-"+str(month)+"-"+str(day)+"&adults="+str(int(rd.random()*4+1))+"&apikey=ha776660837260884554538331946585"

    print(data)

    r = requests.post("http://partners.api.skyscanner.net/apiservices/pricing/v1.0", data=data, headers=headers)

    if r.status_code == 201:
        url2 = r.headers.get("Location");
        d = requests.get(url2, params="apikey=ha776660837260884554538331946585");
        rand = hashlib.sha256(d.text.encode('utf-8')).hexdigest();
        rellevant_bits = rand[0:6]
        x = int(rellevant_bits, 16) & 0x7fffff
        return float(x)/(1 << 23)
    else:
        print("Request failed");
        return random()

